// About.js
import './about.css';

const About = () => {
    return (
        <div className="about-container">
            <header className="about-header">
                <div className="cover-image">
                    <div className="cover-text">
                        <h1>About Us</h1>
                        <p>Discover our story, mission, and team</p>
                    </div>
                </div>
            </header>
            <section className="about-section">
                <div className="about-partitions">
                <div className="partition">
                        <h2>Our Vision</h2>
                        <img src="/images/vision-image.jpg" alt="Our Vision" className="vision-image" /> {/* Add your image path here */}
                        <p>Describe your future goals and aspirations. What are your long-term plans? What impact do you hope to make in your industry or community?</p>
                    </div>
                    <div className="partition">
                        <h2>Our Story</h2>
                        <p>Here’s where you describe your company’s history and background. Add details about how you started, what motivated you, and what you aim to achieve.</p>
                    </div>


                </div>
            </section>
            {/* Other sections go here */}
        </div>
    );
};

export default About;
